import React from 'react'
import Card from 'react-bootstrap/Card'

export default function Flag(props) {
  const flag = props.flag
  return(
    <Card style={{ width: '18rem' }}>
      <Card.Title>Title: {flag.title}</Card.Title>
      <Card.Subtitle className="mb-2 text-muted">Date: {flag.date}</Card.Subtitle>
      <Card.Body>
        Question: {flag.questionId}
        <br/>
        User: {flag.user}
      </Card.Body>
      <Card.Link href={flag.url}>{flag.url}</Card.Link>
    </Card>
  )
}
